import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CustomerRegister = () => {
  const [formData, setFormData] = useState({
    userName: '',
    email: '',
    password: '',
    address: '',
    adharNumber: '',
    drivingLicenseNo: '',
    contact: '',
    cityId: '',
    role: { roleId: 2, roleName: 'Customer' },
    customer: {
      city: {},
      address: '',
      adharNumber: '',
      drivingLicenseNo: '',
      contact: '',
    },
  });

  const [cities, setCities] = useState([]);
  const [loading, setLoading] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');

  useEffect(() => {
    const fetchCities = async () => {
      try {
        const response = await axios.get('http://localhost:8080/cities');
        setCities(response.data);
      } catch (error) {
        console.error('Failed to fetch cities', error);
        setErrorMessage('Failed to fetch cities. Please try again later.');
      }
    };

    fetchCities();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name === 'cityId') {
      const selectedCity = cities.find((city) => city.cityId === parseInt(value));
      setFormData({
        ...formData,
        cityId: value,
        customer: { ...formData.customer, city: selectedCity || {} },
      });
    } else if (name in formData.customer) {
      setFormData({
        ...formData,
        customer: { ...formData.customer, [name]: value },
      });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!formData.userName || !formData.email || !formData.password || !formData.cityId) {
      setErrorMessage('All fields are required.');
      return;
    }

    try {
      setLoading(true);
      setErrorMessage('');

      // Log payload to debug structure
      console.log('Submitting formData:', formData);

      const response = await axios.post('http://localhost:8080/register', formData);

      alert('Customer registered successfully!');
      setFormData({
        userName: '',
        email: '',
        password: '',
        address: '',
        adharNumber: '',
        drivingLicenseNo: '',
        contact: '',
        cityId: '',
        role: { roleId: 2, roleName: 'Customer' },
        customer: {
          city: {},
          address: '',
          adharNumber: '',
          drivingLicenseNo: '',
          contact: '',
        },
      });
      setLoading(false);
    } catch (error) {
      console.error('Registration failed', error);

      // Log response error details
      if (error.response) {
        console.error('Backend Response:', error.response.data);
      }

      setErrorMessage(
        error.response?.data?.message || 'Registration failed, please try again.'
      );
      setLoading(false);
    }
  };

  return (
    <div className="container mt-5">
      <h2>Register as Customer</h2>

      {errorMessage && <div className="alert alert-danger">{errorMessage}</div>}

      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="userName" className="form-label">Name</label>
          <input
            type="text"
            className="form-control"
            id="userName"
            name="userName"
            value={formData.userName}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label htmlFor="email" className="form-label">Email</label>
          <input
            type="email"
            className="form-control"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label htmlFor="password" className="form-label">Password</label>
          <input
            type="password"
            className="form-control"
            id="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label htmlFor="address" className="form-label">Address</label>
          <input
            type="text"
            className="form-control"
            id="address"
            name="address"
            value={formData.customer.address}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label htmlFor="adharNumber" className="form-label">Aadhar Number</label>
          <input
            type="text"
            className="form-control"
            id="adharNumber"
            name="adharNumber"
            value={formData.customer.adharNumber}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label htmlFor="drivingLicenseNo" className="form-label">Driving License No.</label>
          <input
            type="text"
            className="form-control"
            id="drivingLicenseNo"
            name="drivingLicenseNo"
            value={formData.customer.drivingLicenseNo}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label htmlFor="contact" className="form-label">Contact Number</label>
          <input
            type="text"
            className="form-control"
            id="contact"
            name="contact"
            value={formData.customer.contact}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label htmlFor="cityId" className="form-label">City</label>
          <select
            className="form-control"
            id="cityId"
            name="cityId"
            value={formData.cityId}
            onChange={handleChange}
          >
            <option value="">Select City</option>
            {cities.map((city) => (
              <option key={city.cityId} value={city.cityId}>
                {city.cityName}
              </option>
            ))}
          </select>
        </div>

        <button type="submit" className="btn btn-primary" disabled={loading}>
          {loading ? 'Registering...' : 'Register'}
        </button>
      </form>
    </div>
  );
};

export default CustomerRegister;
